import React, { useState } from 'react';

const QuestionnaireForm = () => {
  const [questionOne, setQuestionOne] = useState('');
  const [questionTwo, setQuestionTwo] = useState('');
  const [questionThree, setQuestionThree] = useState('');
  const [questionFour, setQuestionFour] = useState('');
  const [questionFive, setQuestionFive] = useState('');

  const handleQuestionOneChange = (e) => {
    setQuestionOne(e.target.value);
  };

  const handleQuestionTwoChange = (e) => {
    setQuestionTwo(e.target.value);
  };

  const handleQuestionThreeChange = (e) => {
    setQuestionThree(e.target.value);
  };

  const handleQuestionFourChange = (e) => {
    setQuestionFour(e.target.value);
  };

  const handleQuestionFiveChange = (e) => {
    setQuestionFive(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // handle form submission logic here
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="question-one">Question One:</label>
        <input type="range" min="0" max="10" value={questionOne} onChange={handleQuestionOneChange} />
      </div>
      <div>
        <label htmlFor="question-two">Question Two:</label>
        <input type="checkbox" name="question-two" value={questionTwo} onChange={handleQuestionTwoChange} />
      </div>
      <div>
        <label htmlFor="question-three">Question Three:</label>
        <select value={questionThree} onChange={handleQuestionThreeChange}>
          <option value="">Select an option</option>
          <option value="option-one">Option One</option>
          <option value="option-two">Option Two</option>
          <option value="option-three">Option Three</option>
        </select>
      </div>
      <div>
        <label htmlFor="question-four">Question Four:</label>
        <div>
          <label htmlFor="question-four-true">True</label>
          <input type="radio" name="question-four" value="true" onChange={handleQuestionFourChange} />
          <label htmlFor="question-four-false">False</label>
          <input type="radio" name="question-four" value="false" onChange={handleQuestionFourChange} />
        </div>
      </div>
      <div>
        <label htmlFor="question-five">Question Five:</label>
        <textarea value={questionFive} onChange={handleQuestionFiveChange}></textarea>
      </div>
      <button type="submit">Submit</button>
    </form>
  );
};

export default QuestionnaireForm;
